            <Col lg={6} md={6} sm={6} xs={6}>
                Ваши устройства
            </Col>
            <Col lg={6} md={6} sm={6} xs={6}>
                Входы с устройств
            </Col>
        </Row>
        </>
    )
}

export default Security
